import React, { useState } from "react";
import { Link } from "react-router-dom";
import styles from "../modules/Header.module.css";
// import { useState } from "react";

export default function Header() {
  const [isActive, setIsActive] = useState(false);
  const [onScroll, setOnScroll] = useState(false);
  const onNavbarScroll = () => {
    if (window.scrollY >= 80) {
      setOnScroll(true);
    } else {
      setOnScroll(false);
    }
  };

  const onHamburgerClick = () => {
    setIsActive(!isActive);
  };

  window.addEventListener("scroll", onNavbarScroll);

  return (
    <header
      className={onScroll ? styles.navbarContainer : styles.navbarContainer}
    >
      <Link to="/">
        <div className={styles.navbarLogo}>DOMAIN SELLER</div>
      </Link>
      <nav
        className={
          isActive
            ? styles.navbarWrapper + " " + styles.navbarActive
            : styles.navbarWrapper
        }
      >
        <ul className={styles.navbar}>
          <Link to="/tld">
            <li className={styles.navbarItem}>
              <a className={styles.navbarText} href="#">
                TLD
              </a>
            </li>
          </Link>
          <Link to="sld">
            <li className={styles.navbarItem}>
              <a className={styles.navbarText} href="#">
                SLD
              </a>
            </li>
          </Link>
          <Link to="aboutUs">
            <li className={styles.navbarItem}>
              <a className={styles.navbarText} href="#">
                About Us
              </a>
            </li>
          </Link>
          <Link to="contactUs">
            <li className={styles.navbarItem}>
              <a className={styles.navbarText} href="#">
                Contact Us
              </a>
            </li>
          </Link>
        </ul>
      </nav>
      <div
        className={styles.hamburger}
        onClick={() => {
          onHamburgerClick();
        }}
      >
        <div className={styles.arrow1}></div>
        <div className={styles.arrow2}></div>
        <div className={styles.arrow3}></div>
      </div>
    </header>
  );
}
